import{_ as e,o as t,c as a,O as r}from"./chunks/framework.9482e208.js";const v=JSON.parse('{"title":"§ 38.2-3216 Same; operative date for § 38.2-3208.","description":"","frontmatter":{},"headers":[],"relativePath":"vacode/38.2-3216.md","filePath":"vacode/38.2-3216.md"}'),o={name:"vacode/38.2-3216.md"},i=r('<h1 id="§-38-2-3216-same-operative-date-for-§-38-2-3208" tabindex="-1">§ 38.2-3216 Same; operative date for § 38.2-3208. <a class="header-anchor" href="#§-38-2-3216-same-operative-date-for-§-38-2-3208" aria-label="Permalink to &quot;§ 38.2-3216 Same; operative date for § 38.2-3208.&quot;">​</a></h1><p>After July 1, 1962, any insurer may file with the Commission a written notice of its election to comply with the provisions of § <a href="http://law.lis.virginia.gov/vacode/38.2-3208/" target="_blank" rel="noreferrer">38.2-3208</a> after a specified date before January 1, 1968. After the filing of the notice, then upon the specified date, which shall be the operative date of this section for the insurer, § <a href="http://law.lis.virginia.gov/vacode/38.2-3208/" target="_blank" rel="noreferrer">38.2-3208</a> shall become operative with respect to the industrial policies thereafter issued by that insurer. If an insurer makes no election, the operative date of § <a href="http://law.lis.virginia.gov/vacode/38.2-3208/" target="_blank" rel="noreferrer">38.2-3208</a> for the insurer shall be January 1, 1968.</p><p>1962, c. 562, § 38.1-468.2; 1986, c. 562.</p>',3),n=[i];function s(c,h,l,f,d,p){return t(),a("div",null,n)}const m=e(o,[["render",s]]);export{v as __pageData,m as default};
